import React from 'react';
import { makeStyles } from '@mui/styles';
import { Tabs, Tab, Box, Card, CardContent, CardMedia, Typography, Stack } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    heading: {
        fontFamily: 'Montserrat, sans-serif',
        fontWeight: 'bold',
        color: 'white',
        fontSize: '50px',
        textAlign: 'center',
        marginTop: theme.spacing(8),
        marginBottom: theme.spacing(4),
    },
    tabList: {
        backgroundColor: theme.palette.primary.main,
        borderRadius: theme.shape.borderRadius,
        padding: theme.spacing(1),
        marginBottom: theme.spacing(4),
    },
    tab: {
        fontSize: '1.5rem', // Adjust as needed for your design
        fontWeight: 'bold',
        color: 'white',
        marginRight: theme.spacing(2),
        '&:hover': {
            backgroundColor: theme.palette.primary.dark,
        },
        '&.Mui-selected': {
            backgroundColor: theme.palette.primary.dark,
        },
    },
    card: {
        display: 'flex',
        flexDirection: { xs: 'column', sm: 'row' },
        overflow: 'hidden',
        variant: 'elevated',
        backgroundColor: 'rgba(255, 255, 255, 0.8)',
        maxWidth: '97%',
        padding: theme.spacing(4),
        borderRadius: theme.shape.borderRadius,
        marginBottom: theme.spacing(4),
    },
    cardMedia: {
        flex: '0 0 auto',
        width: '100%',
        maxWidth: { xs: '100%', sm: '50%' },
        objectFit: 'cover',
    },
    cardContent: {
        flex: '1 1 auto',
        padding: theme.spacing(0, 4),
    },
}));

const EventsDiscovery = () => {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <>
            <Typography className={classes.heading}>
                Events
            </Typography>
            <Box className={classes.tabList}>
                <Tabs value={value} onChange={handleChange} variant="standard">
                    <Tab className={classes.tab} label="Dance" />
                    <Tab className={classes.tab} label="Music - Classical" />
                </Tabs>
            </Box>
            <Box>
                <Stack spacing={4} mt={4} mb={8}>
                    <Card className={classes.card}>
                        <CardMedia
                            className={classes.cardMedia}
                            component="img"
                            image="/p5.png" // Adjust the image path as needed
                            alt="Logo of Brand"
                        />
                        <CardContent className={classes.cardContent}>
                            <Typography variant="h5" component="h2" gutterBottom>
                                Event 1
                            </Typography>
                            <Typography variant="body1">
                                Our primary goal is to create an app to empower individuals within the arts and performance community...
                            </Typography>
                        </CardContent>
                    </Card>
                    {/* Repeat Card structure for other events */}
                </Stack>
            </Box>
        </>
    );
}

export default EventsDiscovery;
